import React from "react";
import "./Contact.css";
const Contact = () => {
  return (
    <div className="container">
      <h1 className="about-h2">Contact Us</h1>{" "}
      <h2 className="subheading">About Recipe Finder</h2>
      <p className="content">
        Contact Thank you for stopping by FeelGoodFoodie.net. We would love to
        hear from you about any questions, comments or inquiries. You can email
        our team at info {at} feelgoodfoodie {dot} net or use the contact form
        below. RECIPE QUESTIONS If you have questions or feedback about a
        recipe, please leave a comment directly below the recipe in the comment
        section of the post. That way other readers may see and benefit from
        learning about your question or feedback. We love hearing how recipes
        went and if you ever need help troubleshooting a recipe!
      </p>
    </div>
  );
};
export default Contact;
